sys_variable_value.value:
(function execute(inputs, outputs) {

var utils = new x_759224_magic_c_0.scryfall_utils();
var uri;
if(inputs.scryfall_id){
    uri = utils.cardLookUpWithID(inputs.scryfall_id);
}else{
    uri = utils.cardLookUpWithoutID(inputs.set,inputs.cn,inputs.name);
}
outputs.url = uri;

})(inputs, outputs);

